import React from 'react'

export const withAuthRedirect = (Component) => {
    class RedirectComponent extends React.Component {
        render(){
                if(!props.isAuth) return <Redirec to="/login" />
                return <Component {...props}/>
        }
    }
    return RedirectComponent
}
